import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
  {
    path:'/register',
    name:'register',
    component: ()=>import ('@/views/Login/MyRegister.vue'),
  },
  {
    path:'/',
    name:'login',
    component: ()=>import ('@/views/Login/MyLogin.vue'),
  },
  {
    path: '/home',
    name: 'main',
    component:MyMain,
    children:[
      {
        path:'/home/userList',
        component: UserList,
      },

      {
        path:'/home/movieList',
        component: MovieList
      },
      {
        path:'/home/movieCategory',
        component: MovieCategory,
      },
      {
