        component: AddMovie,
      },
      {
        path:'/home/movieAdvertise',
        component: MovieAdvertise,
      },
      {
        path: '/home/moviePlan',
        component: MoviePlan
      },
      {
       path:'/home/movieHall',
       component: MovieHall
      },
      {
        path:'/home/orderList',
        component: OrderList
      }
    ],

  },
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
